import React,{useState,useEffect} from 'react';
function Student(){
	const[data,setData]=useState(10);
	const[data1,setData1]=useState(50);
	const myfun=()=>{
		setData(data+10)
	};
	const myfun1=()=>{
		setData1(data1*10);
	};
	useEffect(()=>{
		console.log("Use Effect invoked");
	},[data]);
	return(
		<>
		<h1>Count of the Data {data}</h1>
		<button onClick={myfun}>increment</button>
		<h1>Count of the Data1 {data1}</h1>
		<button onclick={myfun1}>multiply</button>
		</>
	);
}
export default Student;

